\n        &lt;ul&gt;\n          &lt;li&gt; Address: tcp://172.21.5.4:8786 &lt;/li&gt;\n          &lt;li&gt; Workers: 16 &lt;/li&gt;\n          &lt;li&gt; Threads: 384 &lt;/li&gt;\n          &lt;li&gt; Memory: 2.70 TiB &lt;/li&gt;\n          &lt;li&gt; Dask Version: 2021.11.2 &lt;/li&gt;\n          &lt;li&gt; Dask.Distributed Version: 0+unknown &lt;/li&gt;\n        &lt;/ul&gt;\n        &lt;h2&gt; Calling Code &lt;/h2&gt;\n        &lt;pre&gt;\nfrom dask_interface import Deisa\nfrom dask.distributed import performance_report, wait \nimport dask.array as da\nimport os\nimport time \n\n# Scheduler file name and configuration file\nscheduler_info = 'scheduler.json'\nconfig_file = 'config.yml'\n\n# Initialize the Deisa \nDeisa = Deisa(scheduler_info, config_file)\n\n# Get client\nclient = Deisa.get_client()\n\n# Get data descriptor as a list of Deisa arrays object\narrays = Deisa.get_deisa_arrays()\n#or\n# Get data descriptor as a dict of Dask array\n#arrays = Deisa.get_dask_arrays()\n\n# Select data\ngt = arrays[\"global_t\"][...]\nprint(gt, flush=True)\n\n# Check contract\narrays.check_contract()\n\n# Sign contract\n#arrays.validate_contract()\n\ndef Derivee(F, dx):\n    \"\"\"\n    First Derivative\n       Input: F        = function to be derivate\n              dx       = step of the variable for derivative\n       Output: dFdx = first derivative of F\n    \"\"\"\n    c0 = 2. / 3.\n    dFdx = c0 / dx * (F[3: - 1] - F[1: - 3] - (F[4:] - F[:- 4]) / 8.)\n    return dFdx\n\n# py-bokeh is needed if you wanna see the perf report \nwith performance_report(filename=\"dask-report.html\"):\n    t = time.time()\n    # Construct a lazy task graph \n    \n    der = Derivee(gt, 1)\n    cpt =  da.linalg.norm(der, axis=(1,2))\n\n    #arrays.validate_contract()    \n    # Submit the task graph to the scheduler\n    s = client.persist(cpt, release=True)\n    arrays.validate_contract()   \n    \n    # Print the result, note that \"s\" is a future object, to get the result of the computation, we call `s.result()` to retreive it. \n    print(client.compute(s).result(), flush=True)    \n\n\n    \n# wait until computation is done\n#k = wait(s)\nprint(\"Done in \",time.time() -t,  flush=True)\nclient.shutdown()\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{"high":1,"low":0,"palette":["#ffffFF","#fefeFF","#fdfdFF","#fcfcFF","#fbfbFF","#fafaFF","#f9f9FF","#f8f8FF","#f7f7FF","#f6f6FF","#f5f5FF","#f4f4FF","#f3f3FF","#f2f2FF","#f1f1FF","#f0f0FF","#efefFF","#eeeeFF","#ededFF","#ececFF","#ebebFF","#eaeaFF","#e9e9FF","#e8e8FF","#e7e7FF","#e6e6FF","#e5e5FF","#e4e4FF","#e3e3FF","#e2e2FF","#e1e1FF","#e0e0FF","#dfdfFF","#dedeFF","#ddddFF","#dcdcFF","#dbdbFF","#dadaFF","#d9d9FF","#d8d8FF","#d7d7FF","#d6d6FF","#d5d5FF","#d4d4FF","#d3d3FF","#d2d2FF","#d1d1FF","#d0d0FF","#cfcfFF","#ceceFF","#cdcdFF","#ccccFF","#cbcbFF","#cacaFF","#c9c9FF","#c8c8FF","#c7c7FF","#c6c6FF","#c5c5FF","#c4c4FF","#c3c3FF","#c2c2FF","#c1c1FF","#c0c0FF","#bfbfFF","#bebeFF","#bdbdFF","#bcbcFF","#bbbbFF","#babaFF","#b9b9FF","#b8b8FF","#b7b7FF","#b6b6FF","#b5b5FF","#b4b4FF","#b3b3FF","#b2b2FF","#b1b1FF","#b0b0FF","#afafFF","#aeaeFF","#adadFF","#acacFF","#ababFF","#aaaaFF","#a9a9FF","#a8a8FF","#a7a7FF","#a6a6FF","#a5a5FF","#a4a4FF","#a3a3FF","#a2a2FF","#a1a1FF","#a0a0FF","#9f9fFF","#9e9eFF","#9d9dFF","#9c9cFF","#9b9bFF","#9a9aFF","#9999FF","#9898FF","#9797FF","#9696FF","#9595FF","#9494FF","#9393FF","#9292FF","#9191FF","#9090FF","#8f8fFF","#8e8eFF","#8d8dFF","#8c8cFF","#8b8bFF","#8a8aFF","#8989FF","#8888FF","#8787FF","#8686FF","#8585FF","#8484FF","#8383FF","#8282FF","#8181FF","#8080FF","#7f7fFF","#7e7eFF","#7d7dFF","#7c7cFF","#7b7bFF","#7a7aFF","#7979FF","#7878FF","#7777FF","#7676FF","#7575FF","#7474FF","#7373FF","#7272FF","#7171FF","#7070FF","#6f6fFF","#6e6eFF","#6d6dFF","#6c6cFF","#6b6bFF","#6a6aFF","#6969FF","#6868FF","#6767FF","#6666FF","#6565FF","#6464FF","#6363FF","#6262FF","#6161FF","#6060FF","#5f5fFF","#5e5eFF","#5d5dFF","#5c5cFF","#5b5bFF","#5a5aFF","#5959FF","
